            <ScrollView style={styles.cardFrameContainer} >

                <View style={styles.descriptionContainer}>
                <Text style={styles.frameTitle}>
                    {this.title}  

                </Text>
                <Text style={styles.frameText}  ellipsizeMode='tail' numberOfLines={9}>

               {this.description}

                </Text>

                </View>


               </ScrollView> 


            </View> 
            {this.state.modalVisible?
                    <Modal
                    animationType="slide"
                    transparent={true}
                    visible={this.state.modalVisible}
                   onRequestClose={()=>onCardClick(this.props.item)} 

                    >
                        <ModalView 
                        {...this.props.item}
                        onPressAction={()=>onCardClick(this.props.item)}
                        onUploadAction={()=>onCardClick()}
                        workType={this.props.workType}
                        />
                    </Modal> 
                    :
                    <></>
                    }
            </TouchableOpacity>
        );
    }
}

